// Image
import fImage from '../../Image/Groupe1.png'


export const Register = () => {


    const {id} : {id :string} = useParams();

    const [state, setState] = useState('');


    useEffect(() => {
        if (id === "Signup"){
            setState(<Signup/>)
        } else if( id === "Login"){
            setState(<Login/>)
        } else if( id === "Recovery"){
            setState(<Recovery/>)
        }
    }, [id])

    console.log(setState);

    return(
        <Main>
            {/* {state} */}

        </Main>
    )
}
